import "./App.css";
import Foother from "../src/views/Foother";
import Home from "../src/views/Home";
import Landing from "../src/views/Landing";

function App() {
  return (
    <div className="App">
      <h1>Bienvenidos a mi Portfolio!</h1>
      <Foother></Foother>
      <Home></Home>
      <Landing></Landing>
    </div>
  );
}

export default App;
